def get_dataset_info(dataset_path):
    try:
        # Check if the directory exists
        if not os.path.exists(dataset_path):
            raise FileNotFoundError(f"The directory '{dataset_path}' does not exist.")

        folders = os.listdir(dataset_path)
        subfolder_lengths = {}

        for folder in folders:
            subfolder_path = os.path.join(dataset_path, folder)

            # Check if the subfolder path is a directory
            if os.path.isdir(subfolder_path):
                subfolders = os.listdir(subfolder_path)

                for subfolder in subfolders:
                    subfolder_full_path = os.path.join(subfolder_path, subfolder)
                    # Check if the subfolder is a directory
                    if os.path.isdir(subfolder_full_path):
                        subfolder_length = len(os.listdir(subfolder_full_path))
                        subfolder_lengths[subfolder] = subfolder_length

        return subfolder_lengths

    except FileNotFoundError as e:
        print(f"Error: {e}")

def get_dataset_info(dataset_path):
    folders = ['train', 'test', 'validation']
    subfolder_lengths = {folder: {} for folder in folders}

    for folder in folders:
        subfolders = os.listdir(os.path.join(dataset_path, folder))
        for subfolder in subfolders:
            subfolder_length = len(os.listdir(os.path.join(dataset_path, folder, subfolder)))
            subfolder_lengths[folder][subfolder] = subfolder_length

    return subfolder_lengths
